readyToPlay.text.info.enteredGame = 1.\u672c\u7cfb\u7edf\u9ed8\u8ba4\u7684\u7ba1\u7406\u5458\u8d26\u53f7\u548c\u5bc6\u7801\u662fadmin/password<br>2.\u672c\u7cfb\u7edf\u5f88\u591a\u9898\u90fd\u9700\u8981\u8fdb\u884c\u6d4f\u89c8\u5668\u4ee3\u7406\u6293\u5305,\u62e6\u622a\u8bf7\u6c42,\u4fee\u6539\u8bf7\u6c42,\u53d1\u9001\u8bf7\u6c42ï¼Œ\u8fbe\u5230\u7be1\u6539\u539f\u59cb\u8bf7\u6c42\u7684\u76ee\u7684,\u8bf7\u786e\u4fdd\u60a8\u6709\u4e00\u6b3e\u53ef\u4ee5\u4fee\u6539\u8bf7\u6c42\u5de5\u5177,\u63a8\u8350<a href="https://portswigger.net/burp/releases#community" target="_blank">burp\u793e\u533a\u514d\u8d39\u7248</a><br>3.\u6bcf\u4e2a\u6311\u6218\u9898,\u90fd\u4f1a\u6709\u5bf9\u77e5\u8bc6\u70b9\u8fdb\u884c\u8bb2\u89e3,\u8bf7\u4ed4\u7ec6\u9605\u8bfb\u76f8\u5173\u77e5\u8bc6,\u591a\u6b21\u7b54\u9898\u9519\u8bef\u5c06\u4f1a\u663e\u793a\u63d0\u793a\u4fe1\u606f,\u5c06\u6709\u52a9\u4e8e\u4f60\u627e\u5230\u7b54\u6848,\u6bcf\u4e2a\u6311\u6218\u9898\u5b8c\u6210\u540e,\u90fd\u4f1a\u5728\u754c\u9762\u4e0a\u663e\u793a\u4e00\u4e2a\u901a\u5173\u5bc6\u94a5,\u8bf7\u5c06\u8be5\u5bc6\u94a5\u63d0\u4ea4\u5230\u9875\u9762\u6700\u4e0a\u65b9,\u70b9\u51fb\u63d0\u4ea4\u5b8c\u6210\u672c\u6311\u6218\u9898<br>4.\u6700\u540e\u795d\u4f60\u7b54\u9898\u987a\u5229<br>5.\u9000\u8d39\u8bf4\u660e: <br>1)\u4e00\u5468\u5185\u5b8c\u6210\u6240\u6709\u9898,\u9000100%<br>2)\u4e8c\u5468\u5185\u5b8c\u6210\u6240\u6709\u9898,\u900090%<br>3)\u4e09\u5468\u5185\u5b8c\u6210\u6240\u6709\u9898,\u900050%<br>4)\u8d85\u8fc7\u4e09\u5468\u4e0d\u4e88\u9000\u8d39<br><br><br><br>\u672c\u8bfe\u7a0b\u57fa\u4e8e<a href="https://github4.com/OWASP/SecurityShepherd" target="_blank">owasp SecurityShepherd</a>\u8fdb\u884c\u5f00\u53d1,\u975e\u5e38\u611f\u8c22\u8be5\u9879\u76ee
login.text.download_proxy = <strong>\u9879\u76ee\u6536\u8d39</strong><br>\u672c\u9879\u76ee\u91c7\u7528\u534a\u6536\u8d39\u7684\u5f62\u5f0f,\u771f\u5fc3\u7684\u5e0c\u671b\u5404\u4f4d\u53c2\u4e0e\u540c\u5b66\u771f\u6b63\u7684\u5b66\u4e60\u5230\u5b89\u5168\u77e5\u8bc6,\u5e94\u7528\u5230\u5c06\u6765\u7684\u5f00\u53d1\u9879\u76ee\u4e2d.<br>\u4ec0\u4e48\u662f\u534a\u6536\u8d39<br>1.\u8bfe\u7a0b\u5f00\u59cb\u524d,\u53c2\u4e0e\u5b66\u5458\u9700\u8981\u4ea4 49.9\u5143,\u83b7\u5f97\u6ce8\u518c\u8d26\u53f7<br>2.\u5b66\u5458\u5728\u4e00\u5468\u5185\u5b8c\u6210\u6240\u6709\u8bfe\u7a0b\u5b66\u4e60(\u901a\u5173),\u5219\u8868\u793a\u60a8\u5b66\u6709\u6240\u6210,\u5c06\u5168\u989d\u9000\u8fd8\u60a8\u7684\u8d39\u7528<br>3.\u5b66\u5458\u5728\u4e8c\u5468\u5185\u5b8c\u6210\u6240\u6709\u8bfe\u7a0b\u5b66\u4e60(\u901a\u5173),\u5219\u8868\u793a\u60a8\u5b66\u6709\u6240\u6210,\u5c06\u9000\u8fd890%\u8d39\u7528<br>4.\u5b66\u5458\u5728\u4e09\u5468\u5185\u5b8c\u6210\u6240\u6709\u8bfe\u7a0b\u5b66\u4e60(\u901a\u5173),\u5219\u8868\u793a\u60a8\u5b66\u6709\u6240\u6210,\u5c06\u9000\u8fd850%\u8d39\u7528<br>5.\u5b66\u5458\u5728\u4e09\u5468\u4ee5\u540e\u5b8c\u6210\u6240\u6709\u8bfe\u7a0b,\u5219\u4e0d\u9000\u8fd8\u4efb\u4f55\u8d39\u7528<br>\u8bf4\u660e:\u6bcf\u4e2a\u8bfe\u7a0b\u90fd\u6709\u77e5\u8bc6\u8bb2\u89e3\u548c\u7b54\u9898\u89e3\u91ca,\u76f8\u4fe1\u53c2\u4e0e\u7684\u540c\u5b66\u90fd\u53ef\u4ee5\u5b8c\u6210\u6311\u6218,\u6700\u7ec8\u83b7\u5f97\u5168\u989d\u9000\u8d39<br>\u6ce8\u91ca:\u6bcf\u4f4d\u5b66\u5458\u8d26\u53f7\u6709\u6548\u671f\u4e3a1\u4e2a\u6708,\u5e0c\u671b\u5404\u4f4d\u53c2\u4e0e\u7684\u5b66\u5458\u73cd\u60dc\u53c2\u4e0e\u673a\u4f1a,\u65e9\u65e5\u5b8c\u6210\u8bfe\u7a0b\u5b66\u4e60<br><strong>\u8054\u7cfb\u5ba2\u670d</strong><br>\u52a0\u5b98\u65b9\u5ba2\u670d\u5fae\u4fe1,\u5907\u6ce8:\u5b89\u5168\u5f00\u53d1<br><img   src="data:image/png;base64,">
